      <h1>Siden blev ikke fundet (404)</h1>
      <p>Måske tog siden en dukkert og blev væk i bølgerne? Vi har ledt under luftmadrassen, bag baderingen og mellem badeboldene men vi kan desværre ikke finde det, du leder efter.</p>
      <p>Tag et svømmetag tilbage til forsiden og prøv igen senere, måske dukker den op, når du mindst venter det!</p>
      <TheBtn link="/" title="Forside" text="Gå tilbage til forsiden" icon="arrow_forward"></TheBtn>
